const ManageParty = () => {
  return (
    <table class="styled-table">
      <thead>
        <tr>
          <th>S.N</th>
          <th>Name</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>CPN UML</td>
          <td class="action">Delete</td>
        </tr>
      </tbody>
    </table>
  );
};

export default ManageParty;
